class EmptyClass {


    public void updateHighOrderDerivativesPhase2(final double[] start,
                                                 final double[] end,
                                                 final Array2DRowRealMatrix highOrder) {
        final double[][] data = highOrder.getDataRef();
        for (int i = 0; i < data.length; ++i) {
            final double[] dataI = data[i];
            final double c1I = c1[i];
            for (int j = 0; j < dataI.length; ++j) {
                dataI[j] += c1I * (start[j] - end[j]);
            }
        }
    }
}

class EmptyClass {

private double readDecimalLiteral(int c, boolean resetBuffer) {
        assert c == '.' || isDecimalDigit(c);
        boolean isInteger = true;
        TokenStreamInput input = this.input;
        StrBuffer buffer = resetBuffer ? this.buffer() : this.buffer;
        if (c != '.' && c != '0') {
            buffer.append(c);
            while (isDecimalDigit(c = input.get())) {
                buffer.append(c);
            }
        } else if (c == '0') {
            buffer.append(c);
            c = input.get();
        }
        if (c == '.') {
            isInteger = false;
            buffer.append(c);
            while (isDecimalDigit(c = input.get())) {
                buffer.append(c);
            }
        }
        if (c == 'e' || c == 'E') {
            isInteger = false;
            buffer.append(c);
            c = input.get();
            if (c == '+' || c == '-') {
                buffer.append(c);
                c = input.get();
            }
            if (!isDecimalDigit(c)) {
                throw error(Messages.Key.InvalidNumberLiteral);
            }
            buffer.append(c);
            while (isDecimalDigit(c = input.get())) {
                buffer.append(c);
            }
        }
        if (isDecimalDigitOrIdentifierStart(c)) {
            throw error(Messages.Key.InvalidNumberLiteral);
        }
        input.unget(c);
        if (isInteger) {
            return parseInteger(buffer.array(), buffer.length());
        }
        return parseDecimal(buffer.array(), buffer.length());
    }
}

