class EmptyClass {

private List<Integer> topologicalSort(HashMap<Integer, List<Integer>> table, HashSet<Integer> visited, List<Integer> order, int index) {
    if (visited.contains(index)) return order;

    visited.add(index);

    List<Integer> neighbors = table.get(index);
    for (int i = 0; i < neighbors.size(); i ++) {
      int neighbor = neighbors.get(i);
      if (visited.contains(neighbor)) {
        if (!order.contains(neighbor)) return null;
        continue;
      }

      order = topologicalSort(table, visited, order, neighbor);
      if (order == null) return null;
    }

    order.add(index);
    return order;
  }
}

