            return new ConditionNot(readCondition());
        }
        if (readIf("EXISTS")) {
            read("(");
            Query query = parseSelect();
            read(")");
            return new ConditionExists(query);
        }
        Expression r = readConcat();
        while (true) {
            int backup = parseIndex;
            boolean not = false;
