class EmptyClass {


    public Matcher appendReplacement(StringBuffer sb, String replacement) {

        if (first < 0)
            throw new IllegalStateException("No match available");

        int cursor = 0;
        StringBuilder result = new StringBuilder();

        while (cursor < replacement.length()) {
            char nextChar = replacement.charAt(cursor);
            if (nextChar == '\\') {
                cursor++;
                nextChar = replacement.charAt(cursor);
                result.append(nextChar);
                cursor++;
            } else if (nextChar == '$') {
                cursor++;
                int refNum = (int)replacement.charAt(cursor) - '0';
                if ((refNum < 0)||(refNum > 9))
                    throw new IllegalArgumentException(
                        "Illegal group reference");
                cursor++;

                boolean done = false;
                while (!done) {
                    if (cursor >= replacement.length()) {
                        break;
                    }
                    int nextDigit = replacement.charAt(cursor) - '0';
                    if ((nextDigit < 0)||(nextDigit > 9)) { // not a number
                        break;
                    }
                    int newRefNum = (refNum * 10) + nextDigit;
                    if (groupCount() < newRefNum) {
                        done = true;
                    } else {
                        refNum = newRefNum;
                        cursor++;
                    }
                }
                if (start(refNum) != -1 && end(refNum) != -1)
                    result.append(text, start(refNum), end(refNum));
            } else {
                result.append(nextChar);
                cursor++;
            }
        }
        sb.append(text, lastAppendPosition, first);
        sb.append(result);

        lastAppendPosition = last;
        return this;
    }
}

class EmptyClass {

private List<Integer> topologicalSort(HashMap<Integer, List<Integer>> table, HashSet<Integer> visited, List<Integer> order, int index) {
    if (visited.contains(index)) return order;

    visited.add(index);

    List<Integer> neighbors = table.get(index);
    for (int i = 0; i < neighbors.size(); i ++) {
      int neighbor = neighbors.get(i);
      if (visited.contains(neighbor)) {
        if (!order.contains(neighbor)) return null;
        continue;
      }

      order = topologicalSort(table, visited, order, neighbor);
      if (order == null) return null;
    }

    order.add(index);
    return order;
  }
}

class EmptyClass {

public final DenseMatrix zeros(ValueType valueType, long... size) {
		switch (size.length) {
		case 0:
			throw new RuntimeException("Size not defined");
		case 1:
			throw new RuntimeException("Size must be at least 2-dimensional");
		default:
			switch (valueType) {
			case BIGDECIMAL:
				return new DefaultDenseBigDecimalMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case BIGINTEGER:
				return new DefaultDenseBigIntegerMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case BOOLEAN:
				return new ArrayDenseBooleanMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case BYTE:
				return new DefaultDenseByteMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case CHAR:
				return new DefaultDenseCharMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case DOUBLE:
				if (size.length == 2) {
					return new DefaultDenseDoubleMatrix2D(MathUtil.longToInt(size[ROW]),
							MathUtil.longToInt(size[COLUMN]));
				} else {
					return new DefaultDenseDoubleMatrixMultiD(size);
				}
			case FLOAT:
				return new DefaultDenseFloatMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case INT:
				return new DefaultDenseIntMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case LONG:
				return new DefaultDenseLongMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case OBJECT:
				return ObjectMatrix.Factory.zeros(size);
			case SHORT:
				return new DefaultDenseShortMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case STRING:
				return new DefaultDenseStringMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			default:
				throw new RuntimeException("unknown value type: " + valueType);
			}
		}
	}
}

class EmptyClass {


	public BitMapFontViewer getViewer( String input, int color ) {
		if (this.fontImage == null) {
			initFont();
			if (this.fontImage == null) {
				return null;
			}
		}
		if (!this.hasMixedCase) {
			input = input.toLowerCase();
		}
		int length = input.length();
		int[] indeces = new int[ length ];
		for (int i = length - 1; i >= 0; i-- ) {
			char inputCharacter = input.charAt(i);
			if (inputCharacter == '\n') {
				indeces[i] = BitMapFontViewer.ABSOLUTE_LINE_BREAK;
			} else {
				indeces[i] = this.characterMap.indexOf( inputCharacter );
			}
		}
		if (color != -1 && color != 0)
		{
			return new BitMapFontViewer( this.fontImage, color, indeces, this.xPositions, this.characterWidths, this.fontHeight, this.spaceIndex, 1 );
		}
		else
		{
			return new BitMapFontViewer( this.fontImage, indeces, this.xPositions, this.characterWidths, this.fontHeight, this.spaceIndex, 1 );
		}
	}
}

