public static void addShaped(RecipeDifficulty difficulty, ItemStack result, Object... recipe) {
        if (difficulty != ALL && RecipeDifficulty.getDifficulty() != difficulty) {
            return;
        }

        boolean isOre = false;

        if (!isEnabled(result)) {
            return;
        }

        for (int i = 3; i < recipe.length; i++) {
            if (recipe[i] instanceof String) {
                isOre = true;
            }

            if (!isEnabled(recipe[i])) {
                return;
            }
        }

        if (isOre) {
            IRecipe iRecipe = new ShapedOreRecipe(result, recipe);
            activeCrafting.add(iRecipe);
            GameRegistry.addRecipe(iRecipe);
        }
        else {
            activeCrafting.add(GameRegistry.addShapedRecipe(result, recipe));
        }
    }
}

class EmptyClass {


	private int blendColors(int nFromColor, int nToColor, float nProgress) {
		final float nInverseProgress = 1f - nProgress;

		final float r = Color.red(nToColor) * nProgress + Color.red(nFromColor) * nInverseProgress;
		final float g = Color.green(nToColor) * nProgress + Color.green(nFromColor) * nInverseProgress;
		final float b = Color.blue(nToColor) * nProgress + Color.blue(nFromColor) * nInverseProgress;

		return Color.rgb((int) r, (int) g, (int) b);
	}
}

