class EmptyClass {


    private void addEntries(String newEntries, String modifications, String comment) {
        boolean modified = false;
        int childcount = 0;
        String lastadded = null;
        DefaultMutableTreeNode insert = (DefaultMutableTreeNode) jTreeDesktop.getLastSelectedPathComponent();
        if (!insert.getAllowsChildren()) {
            DefaultMutableTreeNode parent = (DefaultMutableTreeNode) insert.getParent();
            childcount = parent.getIndex(insert) + 1;
            insert = parent;
        }
        int[] entries = Tools.retrieveEntryNumbersFromInput(newEntries, dataObj.getCount(Daten.ZKNCOUNT));
        LinkedList<Integer> multipleEntries = new LinkedList<>();
        showMultipleEntryMsg = true;
        if (entries != null) {
            for (int cnt : entries) {
                if (noDoubleEntries(insert, cnt)) {
                    for (int me = 0; me < desktopObj.getCount(); me++) {
                        if (desktopObj.checkForDoubleEntry(me, cnt)) {
                            multipleEntries.add(cnt);
                        }
                    }
                    lastadded = desktopObj.addEntry(TreeUtil.getNodeTimestamp(insert),
                            String.valueOf(cnt),
                            childcount);
                    if (modifications != null && !modifications.isEmpty()) {
                        desktopObj.addModifiedEntry(lastadded, modifications);
                    }
                    if (comment != null && !comment.isEmpty()) {
                        desktopObj.setComment(lastadded, comment);
                    }
                    modified = true;
                    childcount++;
                }
            }
        }
        if (modified) {
            updateTreeView();
            selectTreePath(lastadded);
            showMultipleOccurencesMessage(Tools.retrieveDoubleEntries(desktopObj, multipleEntries));
        }
    }
}

class EmptyClass {

public final DenseMatrix zeros(ValueType valueType, long... size) {
		switch (size.length) {
		case 0:
			throw new RuntimeException("Size not defined");
		case 1:
			throw new RuntimeException("Size must be at least 2-dimensional");
		default:
			switch (valueType) {
			case BIGDECIMAL:
				return new DefaultDenseBigDecimalMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case BIGINTEGER:
				return new DefaultDenseBigIntegerMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case BOOLEAN:
				return new ArrayDenseBooleanMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case BYTE:
				return new DefaultDenseByteMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case CHAR:
				return new DefaultDenseCharMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case DOUBLE:
				if (size.length == 2) {
					return new DefaultDenseDoubleMatrix2D(MathUtil.longToInt(size[ROW]),
							MathUtil.longToInt(size[COLUMN]));
				} else {
					return new DefaultDenseDoubleMatrixMultiD(size);
				}
			case FLOAT:
				return new DefaultDenseFloatMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case INT:
				return new DefaultDenseIntMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case LONG:
				return new DefaultDenseLongMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case OBJECT:
				return ObjectMatrix.Factory.zeros(size);
			case SHORT:
				return new DefaultDenseShortMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			case STRING:
				return new DefaultDenseStringMatrix2D(MathUtil.longToInt(size[ROW]),
						MathUtil.longToInt(size[COLUMN]));
			default:
				throw new RuntimeException("unknown value type: " + valueType);
			}
		}
	}
}

class EmptyClass {

public static void addShaped(RecipeDifficulty difficulty, ItemStack result, Object... recipe) {
        if (difficulty != ALL && RecipeDifficulty.getDifficulty() != difficulty) {
            return;
        }

        boolean isOre = false;

        if (!isEnabled(result)) {
            return;
        }

        for (int i = 3; i < recipe.length; i++) {
            if (recipe[i] instanceof String) {
                isOre = true;
            }

            if (!isEnabled(recipe[i])) {
                return;
            }
        }

        if (isOre) {
            ResourceLocation location = getNameForRecipe(result);
            ShapedOreRecipe shapedOreRecipe = new ShapedOreRecipe(location, result, recipe);
            shapedOreRecipe.setRegistryName(location);
            GameData.register_impl(shapedOreRecipe);
        }
        else {
            ResourceLocation location = getNameForRecipe(result);
            CraftingHelper.ShapedPrimer primer = CraftingHelper.parseShaped(recipe);
            ShapedRecipes shapedRecipes = new ShapedRecipes(result.getItem().getRegistryName().toString(), primer.width, primer.height, primer.input, result);
            shapedRecipes.setRegistryName(location);
            GameData.register_impl(shapedRecipes);
        }
    }
}

class EmptyClass {


	public boolean feasible(Optimizable innerTable,
							OptimizablePredicateList predList,
							Optimizer optimizer
							)
					throws StandardException 
	{
		ConglomerateDescriptor cd = null;


		if (! innerTable.isMaterializable())
		{
            if ( innerTable.optimizerTracingIsOn() ) { innerTable.getOptimizerTracer().traceSkipUnmaterializableHashJoin(); }
			return false;
		}


		if (innerTable.isTargetTable())
		{
			return false;
		}


		if ((predList != null) && (predList.size() > 0) &&
			!(innerTable instanceof FromBaseTable))
		{
			FromTable ft = (FromTable)innerTable;

			JBitSet tNums = new JBitSet(ft.getReferencedTableMap().size());
			BaseTableNumbersVisitor btnVis = new BaseTableNumbersVisitor(tNums);
			ft.accept(btnVis);

			JBitSet pNums = new JBitSet(tNums.size());

            for (int i = 0; i < predList.size(); i++)
			{
                Predicate pred = (Predicate)predList.getOptPredicate(i);
				if (pred.isJoinPredicate())
					pNums.or(pred.getReferencedSet());
			}

			tNums.and(pNums);
			if (tNums.getFirstSetBit() != -1)
				return false;
		}

		if (innerTable.isBaseTable())
		{

			cd = innerTable.getCurrentAccessPath().getConglomerateDescriptor();
		}


        int[] hashKeyColumns = findHashKeyColumns(
                innerTable,
                cd,
                predList);

		if (SanityManager.DEBUG)
		{
            if ( innerTable.optimizerTracingIsOn() )
            {
                if (hashKeyColumns == null)
                {
                    innerTable.getOptimizerTracer().traceSkipHashJoinNoHashKeys();
                }
                else
                {
                    innerTable.getOptimizerTracer().traceHashKeyColumns( ArrayUtil.copy( hashKeyColumns ) );
                }
            }
		}

		if (hashKeyColumns == null)
		{
			return false;
		}

		return true;
	}
}

