            return Character.TYPE;

        case 68: 
            return Double.TYPE;

        case 70: 
            return Float.TYPE;

        case 73: 
            return Integer.TYPE;

        case 74: 
            return Long.TYPE;

        case 83: 
            return Short.TYPE;

        case 90: 
            return Boolean.TYPE;
        }
        return null;
    }
